import React from 'react'
import axios from 'axios'

function User() {

    const [product, setProduct] = useState(null)

    axios({
        method: 'get',
        url: 'http://127.0.0.1:8000/fighters/',
    }).then(response => {
        setProduct(response.data);
    })
    return (
        <div>
            <h1>The user page</h1>
        </div>
    )
}

export default User
